  false,\n\t\"url\": null,\n\t\"notes\": \" Then               Topological Faces /
  Military Installation Relationship File (FACESMIL.dbf) contains an               record
  for each face / military installation relationship. Face refers to the arealn               (polygon)
  topological primitives that make up MTDB. A face is bounded by one or moren               edges;
  its boundary includes only the edges that separate it from other faces, notn               any
  interior edges contained within the area of the face. The face to which a recordn
  \              in the Topological Faces / Military Installation Relationship File
  (FACESMIL.dbf)n               applies can be determined by linking to the Topological
  Faces Shapefile (FACES.shp)n               on the permanent topological face identifier
  (TFID) attribute. The militaryn               installation to which a record in
  the Topological Faces / Military Installationn               Relationship File (FACESMIL.dbf)
  applies can be determined by linking to the Militaryn               Installation
  Shapefile (MIL.shp) on the military installation identifier (AREAID)n               attribute.
  A face may be part of multiple military installations. A militaryn               installation
  may consist of multiple faces. \",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
